import React, { Component } from "react";
import "../App.css";

export default class Serch extends Component {
  constructor(props) {
    super(props);
  }

  handleChange = (e) => {
    this.props.onChercheChange(e.target.value);
  };
  render() {
    const num = this.props.num;
    return (
      <div>
        <input type="text" value={num} onChange={this.handleChange} />
      </div>
    );
  }
}
